import React, { Component } from "react";
import { connect } from "react-redux";
import { Badge, Col, Row } from "reactstrap";
import { bindActionCreators } from "redux";
import * as homeActions from "../../redux/actions/homeActions";

class HomeList extends Component {
  componentDidMount() {
    this.props.actions.getHomes();
  }

  render() {
    return (
      <div>
        <h3>
          <Badge style={{ marginRight: "10px" }} color="warning">
            Homes
          </Badge>
          <Badge color="success">
            {this.props.currentCategory.categoryName}
          </Badge>
        </h3>
        <Row>
          <Col style={{ margin: "auto" }} xs="4">
            Mwrhaba <br/><br/><br/><br/> <hr/>
          </Col>
          <Col style={{ margin: "auto" }} xs="4">
            Selam
          </Col>
          <Col style={{ margin: "auto" }} xs="4">
            Nas覺ls覺n
          </Col>
          <Col style={{ margin: "auto" }} xs="4">
            Nas覺ls覺n
          </Col>
          <Col style={{ margin: "auto" }} xs="4">
            Selam
          </Col>
          <Col style={{ margin: "auto" }} xs="4">
            Mwrhaba
          </Col>
          <Col style={{ margin: "auto" }} xs="4">
            Selam
          </Col>
        </Row>
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    currentCategory: state.changeCategoryReducer,
    homes: state.homeListReducer,
  };
}

function mapDispacthToProps(dsipatch) {
  return {
    actions: {
      getHomes: bindActionCreators(homeActions.getHomes, dsipatch),
    },
  };
}

export default connect(mapStateToProps, mapDispacthToProps)(HomeList);
